import React, { Component } from 'react'
const TimeEvent = ({time}) => {
    return (
        <>
            <div class="date__event">
                <div class="date__event--text">Esta es la fecha en tu zona horaria</div>
                <div class="date__event--number">time</div>
            </div>
        </>
    )
}

export { TimeEvent }
